&quot;A comprehensive and very well written book. I read it in an old edition with many black and white plates. I hope an all colour edition is available by now. Rewald covers all the artists and the Parisian art scene - it was the first time I understood how the relationships of the painters and their place in 19th century France. It will be difficult to improve on.&quot;

from Goodreads
